import React from 'react';

function Intro() {
  return (
    <div className="intro">
      <h2>Welcome to the Intro Section</h2>
      <ul>
        <li><a href="item1">Item 1</a></li>
        <li><a href="item 2">Item 2</a></li>
        <li>Item 3</li>
      </ul>
    </div>
  );
}

export default Intro;
